import React from 'react';
import '../styles/Carros.css'; // Importando o CSS

const categorias = [
  {
    nome: "VW",
    carros: ["Virtus", "Voyage", "Polo Track", "Gol"]
  },
  {
    nome: "Hyundai",
    carros: ["Ioniq", "Sandero", "Logan", "Duster"]
  },
  {
    nome: "Nissan",
    carros: ["Versa"]
  },
  {
    nome: "Toyota",
    carros: ["Corolla", "Corolla Cross", "Prius", "Etios"]
  },
  {
    nome: "GM",
    carros: ["Spin", "Prisma", "Onix Plus"]
  },
];

function Carros() {
  return (
    <section className="carros">
      <h2>Nossos Carros</h2>
      <div className="carros-list">
        {categorias.map((categoria) => (
          <div className="categoria" key={categoria.nome}>
            <h3>{categoria.nome}</h3>
            <ul>
              {categoria.carros.map((carro) => (
                <li key={carro}>{carro}</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Carros;
